import logo from './logo.svg';
import './App.css';
import { Children } from 'react';

const style2 = {
  boxShadow: '0 5px 3px rgba(0, 0, 0, 0, )',
};

const style1 = (backgroundColor = '#333') => ({
  backgroundColor: backgroundColor,
  color: '#fff',
  padding: '10px 15px',
  margin: '10px 15px', 
});

const Li = ({children, id}) => {
  // console.log(props);

  return (
    <li 
      className='css-li'
      style={{...style1(), ...style2}}
    >
        {children} {id}
    </li>
  );
};

function App() {
  const value = 'test';

  return (
    <ul 
      className='css-ul'
      style={style1('#750')}
      >
      <Li id='1'>value</Li>
    </ul>
  );
}

export default App;
